    const handleLogout = ()=>{
        removeUser()
        console.log('zoulema')

    }
    return(
        <div className="header" >
            
                
                <div className="welcome" >Welcome: {memoryUtil.user.name }</div>
                <div className="logout" >
                    <a href="/login"  type="link" onClick={handleLogout} >Logout</a>
                </div>
            
            <div className="lowerHeader" >
                <TopNav />
            </div>
        </div>
    )
}
export default Header
